import{_ as e,c as a,o as t,a as s}from"./app.97a7b2ae.js";var r="/assets/compilers-do.e5c517c5.png",o="/assets/compilers-do1.4d0002b2.png",i="/assets/intepreters-do.d3f2ed8c.png",p="/assets/hybrid-compiler.dc66c3d5.png",n="/assets/structure-of-compiler.546ab5e3.png",l="/assets/examples-of-compiler.defdff54.png";const q='{"title":"\u7F16\u8BD1\u539F\u7406","description":"","frontmatter":{},"headers":[],"relativePath":"compilers/\u6982\u8FF0.md","lastUpdated":1646059216000}',c={},d=s('<h4 id="\u7F16\u8BD1\u539F\u7406" tabindex="-1">\u7F16\u8BD1\u539F\u7406 <a class="header-anchor" href="#\u7F16\u8BD1\u539F\u7406" aria-hidden="true">#</a></h4><blockquote><p>\u5F15\u8A00\uFF1A \u5982\u679C\u4F60\u4E0D\u80FD\u7406\u89E3\uFF0C\u90A3\u4E48\u4F60\u8BB0\u4E0D\u4F4F</p></blockquote><p>\u5B66\u4E60\u4E66\u7C4D\uFF1ACompilers Principles,Techniques &amp; tools</p><blockquote><p>Programming languages are notations for describing computations to people and to machines.</p></blockquote><p>\u7A0B\u5E8F\u8BED\u8A00\u5C31\u662F\u7ED9\u4EBA\u770B\u7684\uFF0C\u5C31\u662F\u5411\u4EBA\u63CF\u8FF0\u8BA1\u7B97\u8FC7\u7A0B\u7684\uFF0C\u5E76\u4E14\u80FD\u591F\u88AB \b \u7F16\u8BD1\u6210\u673A\u5668\u8FD0\u884C\u7684\u8BED\u8A00</p><blockquote><p>The software systems that do this translation are called compilers.</p></blockquote><p>\u505A\u8FD9\u79CD\u8F6C\u8BD1\u7684\u8F6F\u4EF6\u7CFB\u7EDF\u5C31\u88AB\u79F0\u4E3A\u7F16\u8BD1\u5668</p><h5 id="the-diference-between-compilers-and-intepretors" tabindex="-1">the diference between compilers and intepretors <a class="header-anchor" href="#the-diference-between-compilers-and-intepretors" aria-hidden="true">#</a></h5><p>\u7F16\u8BD1\u5668\u548C\u89E3\u91CA\u5668\u7684\u533A\u522B</p><ul><li>\u540C\u6837\u4F5C\u4E3A\u8BED\u8A00\u5904\u7406\u5668,</li><li>\u7F16\u8BD1\u5668\u662F\u5C06\u4E00\u6BB5\u9AD8\u7EA7\u8BED\u8A00\u7684\u7A0B\u5E8F\u8F6C\u6362\u4E3A\u4F4E\u7EA7\u8BED\u8A00\u7A0B\u5E8F<img src="'+r+'" alt="">\uFF0C\u6216\u8005\u662F\u5C06\u4E00\u4E2A\u63A5\u53D7\u8F93\u5165\u7684\u53EF\u6267\u884C\u7684\u673A\u5668\u8BED\u8A00\u7A0B\u5E8F\u76F4\u63A5\u8FD0\u884C\u8F93\u51FA\u7ED3\u679C\u3002<img src="'+o+'" alt=""></li><li>\u89E3\u91CA\u5668\u662F\u76F4\u63A5\u6267\u884C\u7684\u7528\u6237\u8F93\u5165<img src="'+i+'" alt=""><blockquote><p>an intepreters appears to directly execute the operation specified in the source program on input supplied by the user.</p></blockquote></li></ul><p>\u6BD4\u5982 java \u8BED\u8A00\u5C31\u4F1A\u9996\u5148\u88AB\u7F16\u8BD1\u6210\u5B57\u8282\u7801\uFF0C\u7136\u540E\u7531 Java \u7684\u865A\u62DF\u673A\u6267\u884C <img src="'+p+'" alt=""></p><h5 id="\u7F16\u8BD1\u5668\u7684\u7ED3\u6784" tabindex="-1">\u7F16\u8BD1\u5668\u7684\u7ED3\u6784 <a class="header-anchor" href="#\u7F16\u8BD1\u5668\u7684\u7ED3\u6784" aria-hidden="true">#</a></h5><blockquote><p>up to this point we have treated a compiler as a single box that maps source program into semantically equivalent target program. if we open this box a little, we see that there are two parts to this mapping: analysis and synthesis.</p></blockquote><p>\u7B80\u800C\u8A00\u4E4B\uFF0C\u5206\u6790 \u548C \u5408\u6210\u3002 \u5206\u6790\u9636\u6BB5\u522B\u88AB\u79F0\u4E3A\u7F16\u8BD1\u5668\u7684\u524D\u7AEF\u90E8\u5206\uFF0C\u5C06\u6E90\u7A0B\u5E8F\u8F6C\u6362\u4E3A\u4E00\u79CD\u4E2D\u95F4\u8868\u793A\u5F62\u5F0F\uFF0C\u5206\u6790\u5176\u4E2D\u662F\u5426\u6709\u53E5\u6CD5\u9519\u8BEF\uFF0C\u5E76\u628A\u4E00\u4E9B\u6570\u636E\u4FE1\u606F\u5B58\u50A8\u5728\u4E00\u4E2A\u53EB\u505A symbol table \u7684\u5730\u65B9\u3002 \u5408\u6210\u88AB\u79F0\u4E3A\u7F16\u8BD1\u5668\u7684\u540E\u7AEF\u90E8\u5206\uFF0C\u5C06\u8FD9\u79CD\u4E2D\u95F4\u5F62\u5F0F\u7684\u4EE3\u7801\u751F\u6210\u673A\u5668\u4EE3\u7801\u3002 <img src="'+n+`" alt=""></p><p>\u5F80\u66F4\u7EC6\u4E86\u8BF4\uFF0C\u53EF\u4EE5\u5206\u4E3A\u4E0B\u9762\u8FD9\u4E9B\u9636\u6BB5 \u8BCD\u6CD5\u5206\u6790-&gt;\u53E5\u6CD5\u5206\u6790-&gt;\u8BED\u4E49\u5206\u6790-&gt;\u4E2D\u95F4\u4EE3\u7801-&gt;\u673A\u5668\u4EE3\u7801\u4F18\u5316-&gt;\u4EE3\u7801\u751F\u6210</p><p>\u6BD4\u5982\u5982\u4E0B\u7684\u4EE3\u7801</p><div class="language-java"><pre><code>position <span class="token operator">=</span> initial <span class="token operator">+</span>  rate <span class="token operator">*</span> <span class="token number">60</span>
</code></pre></div><p>\u4F1A\u7ECF\u5386\u4E0B\u9762\u7684\u5904\u7406\u8FC7\u7A0B <img src="`+l+'" alt=""></p><h5 id="\u7F16\u8BD1\u5668\u7684\u5E94\u7528" tabindex="-1">\u7F16\u8BD1\u5668\u7684\u5E94\u7528 <a class="header-anchor" href="#\u7F16\u8BD1\u5668\u7684\u5E94\u7528" aria-hidden="true">#</a></h5><p>\u7F16\u8BD1\u5668\u53EF\u4EE5\u88AB\u7528\u5728\u4EE5\u4E0B\u65B9\u9762</p><ul><li>\u9AD8\u7EA7\u7A0B\u5E8F\u8BED\u8A00\u7684\u5B9E\u73B0\u3002\u9AD8\u7EA7\u7A0B\u5E8F\u8BED\u8A00\u76F8\u6BD4\u800C\u8A00\u5BB9\u6613\u4E66\u5199\u548C\u7406\u89E3\uFF0C\u4F46\u662F\u6267\u884C\u5374\u76F8\u5BF9\u8F83\u6162\u3002\u5BF9\u9762\u5411\u5BF9\u8C61\u7684\u652F\u6301\uFF0C\u4E5F\u662F\u5E94\u7528\u4E4B\u4E00\u3002</li><li>\u8BA1\u7B97\u673A\u4F53\u7CFB\u7ED3\u6784\u7684\u4F18\u5316,\u5E76\u884C\uFF0C\u5185\u5B58\u5C42\u6B21\u7ED3\u6784\u3002</li><li>\u8F6F\u4EF6\u751F\u4EA7\u6548\u7387\u5DE5\u5177\u3002\u7C7B\u578B\u68C0\u67E5\uFF0C\u8FB9\u754C\u68C0\u67E5\u3002</li><li>\u7A0B\u5E8F\u8BBE\u8BA1\u8BED\u8A00\u7684\u57FA\u7840\u3002\u52A8\u6001\u9759\u6001\u8BED\u8A00\u7C7B\u578B\u3002</li></ul>',21),h=[d];function m(_,u,g,b,f,k){return t(),a("div",null,h)}var x=e(c,[["render",m]]);export{q as __pageData,x as default};
